package com.liveeeasy.web.absorption.demo.spider.wuba.service.impl;import com.liveeeasy.web.absorption.demo.spider.wuba.dao.WuBaEstateDao;import com.liveeeasy.web.absorption.demo.spider.wuba.service.IWuBaEstateService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;import java.util.Map;@Servicepublic class WuBaWuBaEstateServiceImpl implements IWuBaEstateService {    @Autowired    private WuBaEstateDao estateDao;    @Override    public int BaseBatchInsert(List<Map<String, Object>> baseList) {        if(baseList.size() > 0){            return estateDao.BaseBatchInsert(baseList);        }        return 0;    }    @Override    public int picBatchInsert(List<Map<String, Object>> picList) {        if(picList.size() > 0){            return estateDao.picBatchInsert(picList);        }        return 0;    }    @Override    public int expertBatchInsert(List<Map<String, Object>> expertList) {        if(expertList.size() > 0){            return estateDao.expertBatchInsert(expertList);        }        return 0;    }}